import React, { useState,useEffect } from "react";
import PropTypes from "prop-types";
import { ProjectsContent } from "../data/projectsContent";
import "./projectsPage.css";
import Header from "../components/header";
import Footer from "../components/footer";
import FilterMenu from "../components/filtermenu";


const API = process.env.REACT_APP_API;

const search_word = 'Livre+de+scraping+en+python';


const ProjectsPage = ({ results }) => {


  const [products, setProduct] = useState([]);

  console.log("-----------getProduct----------");

  const getProducts = async () => {

    const res = await fetch(`${API}/products/${search_word}/`);

    const data = await res.json();

    setProduct(data);


  };


  useEffect(()=>{

    getProducts();



  },[])

  return (
    <div className="main">
      <Header />
      <FilterMenu />
      <div className="all-results-container">
        <p className="result-count">
        A propos {products.length} resultats trouv√©s (10.67 secondes)
        </p>
        <div className="projects-content">
          {ProjectsContent.map((item) => (
            <div className="projects-card">
              <a href={`${item.link}`} className="project-link">
                <p> {`${item.link}`} </p>
                <h3>{`${item.name}`}</h3>
              </a>
              <div className="projects-details">
                <div className="projects-img-container">
                  <img src={item.img} alt={item.name} />
                </div>
                <div className="projects-text-container">
                  <p className="projects-excerpt">{`${item.excerpt}`}</p>
                  <p className="projects-tools">''  {`${item.tools}`}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
      <Footer />
    </div>
  );
};

export default ProjectsPage;
